What a night! The wrap party for the Jean-Michel Basquiat exhibition took you right back to a time in NYC only 80's pictures and films can describe. L.E.S. The Village, parts of Brooklyn still have remnants of the vibe that birthed this  Artist🎨. It was beautiful to meet his sisters and see the passion they have for preserving the Basquiat name and legacy. And we were partying like we were in PALLADIUM !!! S/O @vice @citi  and all those that made this exhibition and closing party something to celebrate Jean-Michel's 62nd birthday🎂 .
